import React from "react";
import Alert from 'react-bootstrap/Alert';


const Brand_props = (b) => {
    return (
        // <>
        //     <div className="brand-child1">
        //         <img src={b.img} alt=""/>
        //     </div>
        // </>
        <>
            {[
                'primary',
                'secondary',
                'success',
                'danger',
                'warning',
                'info',
                'light',
                'dark',
            ].map((variant) => (
                <Alert key={variant} variant={variant}>
                    This is a {variant} alertâ€”check it out!
                </Alert>
            ))}
        </>
    )
}

export default Brand_props
